def find_final_weight(Triangle, W0):
    current_weight = W0
    current_index = 0

    for row in Triangle:
        WL = row[current_index]
        WR = current_weight

        if WL >= WR:
            current_weight = WL
        else:
            current_weight = WR
            current_index = current_index + 1

    return current_weight


